package vn.com.kodergang.shop.entity;import javax.persistence.*;import java.util.Date;@Entity@Table(name = "AD_SESSION")public class AdSession {    @Id    @Column(name = "SESSION_ID")    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Integer sessionId;    @Column(name = "USER_ID")    private Integer userId;    @Column(name = "CREATE_TIME")    private Date createTime;    @Column(name = "TOKEN")    private String token;    @Column(name = "IP_ADDRESS")    private String ipAddress;    public AdSession(Integer userId, String ipAddress) {        this.userId = userId;        this.ipAddress = ipAddress;        this.createTime = new Date();    }    public void setSessionId(Integer sessionId) {        this.sessionId = sessionId;    }    public void setUserId(Integer userId) {        this.userId = userId;    }    public void setCreateTime(Date createTime) {        this.createTime = createTime;    }    public void setToken(String token) {        this.token = token;    }    public void setIpAddress(String ipAddress) {        this.ipAddress = ipAddress;    }    public Integer getSessionId() {        return sessionId;    }    public Integer getUserId() {        return userId;    }    public Date getCreateTime() {        return createTime;    }    public String getToken() {        return token;    }    public String getIpAddress() {        return ipAddress;    }}